import React from 'react';
import './OvenItem.css';
import Loader from "../reusableComponents/Loader";

const OvenItem=({ovenData,setupData})=>{

    let ovenview=null;

    if(ovenData!=null && setupData!=null && ovenData.length>0 && setupData.length>0) {
        ovenview = <div className="oven-wrapper">
            <div className="oven-section1">
                <div>{ovenData[0].State}</div>
                <div>{ovenData[0].Name}</div>
                <div> {ovenData[0].CurrentTemperature}</div>
            </div>
            <div className="oven-section2">
                Profile: {ovenData[0].ProgramName} Goal: {ovenData[0].ProgramName}
            </div>
            <div className="oven-section3">
                <div>ready</div>
                <div>available</div>
                <div>found</div>
                <div>NF</div>
                <div>NA</div>
            </div>
            <div className="oven-section4">
                analytics
            </div>
        </div>
    }


    return(
        <div>{ovenview!=null ? (
        {ovenview}

    ):(
            <Loader/>
    )
    }
        </div>
    )
}

export default OvenItem;
